import SearchBar from "../searchbar/searchbar.component";
import "./home.styles.scss";

const Home = () => {
  return (
    <div className="homeContainer">
      <div className="contentContainer">
        <h2>Hi User!</h2>
        <SearchBar />
      </div>

      {/* Logos location */}
      <div></div>
    </div>
  );
};

export default Home;
